import React from 'react';
import './App.css';
import { Login, Register, Welcome } from "./components/login/index";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <LoginRoute />
        <RegisterRoute />
      </Router>
    </div>
  );

}

const LoginRoute = () => {
  return (
    <Switch>
      <Route component={Login} />
    </Switch>

  )
}
const RegisterRoute = () => {
  return (
    <Switch>
      <Route component={Register} />
    </Switch>

  )
}
const WelcomeRoute = () => {
  return (
    <Switch>
      <ProtectedRoute component={Welcome} />
    </Switch>

  )
}

const ProtectedRoute = ({component:Component,...rest}) => {
  return (
    <Route
  {...rest}
  render = {() => (
  <Component/>
  )}
  />
  )
}

export default App;
